 1) LA CONFECCIÓN DE PROYECTOS, LA EJECUCIÓN Y EL MANTENIMIENOT INTEGRAL DE OBRAS E INSTALACIONES. DENTRO DE ESTE CONCEPTO ESTARÁN INCLUÍDAS LA SIGUIENTES ACTIVIDADES Y SERVICIOS: &#13;
A) LA LIMPIEZA DE EDIFICIOS Y LOCALES EN GENERAL, LIMPIEZA DE FÁBRICAS E INSTALACIONES INDUSTRIALES, BARCOS, AERONAVES, AEROPUERTOS, HOSPITALES, CABINAS, PARQUES, JARDINES, MONTES, PLAYAS,VÍAS Y ESPACIOS PÚBLICOS Y PRIVADOS, URBANOS E INTERURBANOS, ALCANTARILLAS, CONDUCCIONES INDUSTRIALES Y SANITARIAS Y LA DESRATIZACIÓN, DESINFECCIÓN Y DESINSECTACIÓN DE LOS MISMOS ESPACIOS SEÑALADOS ANTERIORMENTE, ASÍ COMO LA RECOGIDA Y TRANSPORTE DE BASURAS Y RESIDUOS, INORGÁNICOS Y ORGÁNICOS, URBANOS E INDUSTRIALES (INCLUSO LOS DE PROCEDENCIA HOSPITALARIA) Y LA ELIMINACIÓN HIGIÉNICO-SANITARIA, TRATAMIENTO O RECUPERACIÓN DE LOS MISMOS; LA HIGIENIZACIÓN DE AGUAS MARÍTIMAS, FLUVIALES Y RESIDUALES, TANTO URBANAS COMO INDUSTRIALES, Y DEL MEDIO AMBIENTE EN GENERAL. SERVICIOS DE DESCONTAMINACIÓN DE INSTALACIONES RADIACTIVAS, SANITARIAS Y CENTRALES NUCLEARES. SERVICIOS DE LAVANDERÍA Y TINTE DE TODA CLASE DE VESTUARIO Y ROPA, ASÍ COMO LA LIMPIEZA DE CORTINAS, ALFOMBRAS Y TAPICES. B) LA CONFECCIÓN DE PROYECTOS Y LA PRESTACIÓN DE SERVICIOS EN ORDEN AL MANTENIMIENTO INTEGRAL DE TODO TIPO DE INSTALACIONES INDUSTRIALES, ESPACIOS Y VÍAS URBANAS E INTERURBANAS Y DE EDIFICIOS EN GENERAL, INCLUIDA LA EJECUCIÓN DE OBRAS, MEDIANTE TRABAJOS DE ELECTRICIDAD EN ALTA Y BAJA TENSIÓN, DE ACONDICIONAMIENTO DE AIRE, FRÍO INDUSTRIAL, CALEFACCIÓN, EQUIPOS Y APARATOS A PRESIÓN E INSTALACIONES DE PROTECCIÓN CONTRA INCENDIOS, FONTANERÍA, CARPINTERÍA, PINTURA, ALBAÑILERÍA, MANTENIMIENTO DE APARATOS DE RAYOS X PARA DIAGNÓSTICO MÉDICO, APARATOS ELECTROMÉDICOS, MANTENIMIENTO DE INSTALACIONES ELECTROMECÁNICAS, DE ASCENSORES Y APARATOS DE ELEVACIÓN O TRANSPORTE DE CARGAS, ACTUACIONES EN ACOMETIDAS, CENTROS DE ALMACENAMIENTO Y REDES DE DISTRIBUCIÓN INTERIOR O EXTERIOR DE AGUA, GAS Y OTROS COMBUSTIBLES APARATOS A PRESIÓN, DEPÓSITOS DE GAS Y OTROS COMUSTIBLES LÍQUIDOS, INSTALACIONES DE PRODUCTOS PETROLÍFEROS LÍQUIDOS Y MANTENIMIENTO Y REPARACIÓN DE EQUIPOS Y MAQUINARIA DE OFICINA, Y LA UTILIZADA EN PROCESOS INDUSTRIALES, EN LA CONSTRUCCIÓN, EN LA AGRICULTURA, EN LA MINERÍA Y EN LA SELVICULTURA, ASÍ COMO LAS MÁQUINAS, HERRAMIENTAS Y UTILLAJE DE OFICINA; LIMPIEZA, MANTENIMIENTO Y REPARACIÓN DE VEHÍCULOS AUTOMOTORES, BUQUES Y AERONAVES. C)  TRABAJOS DE MANTENIMIENTO Y REPARACIÓN DE TODO TIPO DE MEDIOS DE TRANSPORTE, TALES COMO AUTOMÓVILES, AUTOCARES, CAMIONES, FURGONETAS, MOTOCICLETAS, BICICLETAS, EMBARCACIONES, AERONAVES, FERROCARRILES, INCLUSO LOS METROPOLITANOS, TRANVÍAS Y OTRO MATERIAL RODANTE, EN INSTALACIONES PROPIAS O DE TERCEROS. D) SERVICIOS DE INSTALACIÓN, MANTENIMIENTO Y REPARACIÓN DE EQUIPOS E INSTALACIONES INFORMÁTICOS Y DE TELECOMUNIDACIONES, CONSISTENTES EN LA REALIZACIÓN DE TRABAJOS DE MANTENIMIENTO PREVENTIVO O CORRECTIVO Y DE REPARACIÓN DE EQUIPOS Y SISTEMAS FÍSICOS Y LÓGICOS PARA EL TRATAMIENTO DE LA INFORMACIÓN, ASÍ COMO DE LOS EQUIPOS EMISORES Y RECEPTORES DE LA MISMA Y SUS CORRESPONDIENTES SISTEMAS Y MEDIOS DE TRANSMISIÓN; SERVICIOS DE TELECOMUNICACIONES, DE COMUNICACIÓN DE VOZ Y/O DATOS, ALQUILER DE CIRCUITOS PARA LA TRANSMISIÓN DE VOZ Y/O DATOS, LA PROVISIÓN DE MEDIOS TÉCNICOS Y HUMANOS NECESARIOS PARA QUE LOS USUARIOS FINALES DE LAS REDES DE TELECOMUNICACIONES ACCEDAN Y TENGAN PRESENCIA EN INTERNET Y OTROS SERVICIOS DE VALOR AÑADIDO SOBRE REDES DE TELECOMUNICACIONES. INSTALACIÓN Y MANTENIMIENTO DE INFRAESTRUCTURAS DE TELECOMUNICACIÓN EN EDIFICIOS, ASÍ COMO DE SISTEMAS DE TELECOMUNICACIÓN, SISTEMAS AUDIOVISUALES, CENTROS EMISORES DE RADIOCOMUNICACIONES Y VEHÍCULOS MÓVILES. E) INSTALACIÓN Y MANTENIMIENTO DE PLACAS SOLARES FOTOVOLTÁICAS Y TÉRMICAS, ASÍ COMO DE INSTALACIONES DE ENERGÍA EÓLICA Y OTRAS ENERGÍAS RENOVABLES, TANTO TÉRMICAS COMO ELÉCTRICAS Y SOLARES. F) GESTIÓN ENERGÉTICA DE INFRAESTRUCTURAS, INCLUYENDO LA COMPRA Y VENTA DE ENERGÍA; GESTIÓN DEL AGUA: DEPURACIÓN, FILTRADO Y DISTRIBUCIÓN. G) LA CONFECCIÓN DE PROYECTOS Y EJECUCIÓN DE OBRAS DE CONSTRUCCIÓN Y RESTAURACIÓN EXTERNA E INTERNA DE LAS ESTRUCTURAS Y REVESTIMIENTO DE TODA CLASE DE EDIFICIOS, MONUMENTOS, VIVIENDAS, Y ESPACIOS Y VÍAS PÚBLICAS Y PRIVADAS, SU LIMPIEZA, IMPERMEABILIZACIÓN, TRATAMIENTO, PINTADO RECONSTRUCCIÓN Y ADAPTACIÓN. H) LA CONFECCIÓN DE ESTUDIOS Y PROYECTOS RELACIONADOS CON EL MEDIO AMBIENTE, PARQUES, JARDINES, ÁREAS FORESTALES, VIALES, VÍAS Y PASILLOS VERDES, CAMINOS NATURALES ASÍ COMO SU EJECUCIÓN CON SU CORRESPONDIENTE INFRAESTRUCTURA (RED DE RIEGO Y DRENAJES, ILUMINACIÓN, FUENTES, MOBILIARIO URBANO, SEÑALIZACIÓN Y BALIZAMIENTO), MOVIMIENTO DE TIERRAS. COMPRA VENTA, SUMINISTRO, CONSERVACIÓN Y MANTENIMIENTO DE MOBILIARIO URBANO Y JUEGOS INFANTILES. I) RESTAURACIÓN MEDIOAMBIENTAL, ADECUACIÓN Y LIMPIEZA DE RIBERAS, MÁRGENES Y CAUCES DE RÍOS, ACTUACIONES MEDIOAMBIENTALES EN ZONAS LITORALES, EN COSTAS Y CORRECCIONES DE DUNAS, ASÍ COMO GESTIÓN, RESTAURACIÓN, CONSERVACIÓN, MANTENIMIENTO Y MEJORA DE ESPACIOS PROTEGIDOS (PARQUES NATURALES, PARQUES NACIONALES, RESERVAS DE LA BIOSFERA), HABITAT Y ECOSISTEMAS. J) LA IMPLANTACIÓN, CUIDADO Y MANTENIMIENTO DE JARDINES, ZONAS VERDES, VIVEROS Y EXPLOTACIONES FORESTALES, ASÍ COMO CUALQUIER OBRA O SERVICIO QUE TENGA POR OBJETO SU APROVECHAMIENTO Y CONSERVACIÓN, LA EJECUCIÓN DE CAMINOS FORESTALES, VÍAS DE SACA, CONSTRUCCIÓN DE DIQUES PARA LA PREVENCIÓN DE LA EROSIÓN, ASÍ COMO CUALQUIER OBRA O SERVICIO QUE TENGA POR OBJETO SU MANTENIMIENTO. K) PROYECTO Y EJECUCIÓN DE CAMPOS DE GOLF, ASÍ COMO DE PAVIMENTOS DEPORTIVOS DE HIERBA NATURAL Y ARTIFICIAL CON TODA SU INFRAESTRUCTURA. L) ACTUACIONES PARA LA DEFENSA DE MÁRGENES DE RÍOS Y SU ENCAUZAMIENTO, INCLUSO EMPLEANDO TÉCNICAS DE BIOINGENIERÍA. RECUPERACIÓN DE VALORES PAISAJÍSTICOS Y AMBIENTALES EN CAUCES FLUVIALES Y REGENERACIÓN DEL BOSQUE DE GALERÍA. M) SERVICIOS DE PROTECCIÓN DE FLORA Y FAUNA. N) DESARROLLO, EJECUCIÓN Y GESTIÓN DE INSTALACIONES RELACIONADAS CON EL MEDIO NATURAL Y USO PÚBLICO, TALES COMO AULAS DE NATURALEZA, CENTROS DE INTERPRETACIÓN, OBSERVATORIOS DE AVES, CENTROS DE REPRODUCCIÓN, ETC. 2) LA IMPORTACIÓN Y EXPORTACIÓN DE TODA CLASE DE BIENES, EQUIPOS, PRODUCTOS Y TÉCNICAS, EXCLUÍDOS LOS SOMETIDOS A LEGISLACIÓN ESPECIAL. 3) LA COMPRAVENTA, CESIÓN POR CUALQUIER TÍTULO, ARRENDAMIENTO, COMERCIALIZACIÓN, ALMACENAJE, DISTRIBUCIÓN, SUMINISTRO, FABRICACIÓN, DISEÑO, PROYECTO, MONTAJE, MANEJO Y ASISTENCIA TÉCNICA DE APARATOS, EQUIPOS, EQUIPAMIENTOS, PRODUCTOS Y DISPOSITIVOS RELACIONADOS CON IMPLANTES, PRÓTESIS, FÁRMACOS Y MATERIALES SANITARIOS O CON DESTINO A CENTROS SANITARIOS, TANTO PROPIOS COMO DE TERCEROS, ASÍ COMO DE APARATOS, EQUIPOS O PRODUCTOS QUE TENGAN POR FIN EL CONTROL Y OPTIMIZACIÓN DE CONSUMOS ENERGÉTICOS,  LA PLANIFICACIÓN DEL MANTENIMIENTO  ENERGÉTICO DE EDIFICIOS, INSTALACIONES NDUSTRIALES, O DE CUALQUIER OTRA NATURALEZA. LA COMPRAVENTA, CESIÓN POR CUALQUIER TÍTULO, ARRENDAMIENTO Y COMERCIALIZACIÓN DE TÉCNICAS, MÉTODOS O SERVICIOS QUE TENGAN POR OBJETO LOS PRECITADOS FINES. 4) LA PRESTACIÓN DE SERVICIOS AUXILIARES Y COMPLEMENTARIOS EN URBANIZACIONES, FINCAS URBANAS, INSTALACIONES INDUSTRIALES, INFRAESTRUCTURAS DE TRANSPORTE, REDES VIALES, CENTROS COMERCIALES, ORGANIMOS OFICIALES Y DEPENDENCIAS ADMINISTRATIVAS, INSTALACIONES DEPORTIVAS O DE RECREO, MUSEOS, RECINTOS FERIALES, SALAS DE EXPOSICIONES, CONFERENCIAS Y CONGRESOS, HOSPITALES, CONVENCIONES, INAUGURACIONES, CENTROS CULTURALES Y DEPORTIVOS, EVENTOS DEPORTIVOS, SOCIALES Y CULTURALES, EXPOSICIONES, CONFERENCIAS, JUNTAS, RECEPCIONES, RUEDAS DE PRENSA, CENTROS DOCENTES, PARQUES, INSTALACIONES AGROPECUARIAS, BOSQUES, FINCAS RÚSTICAS, COTOS DE CAZA, RECINTOS DE RECREO Y DE ESPECTÁCULOS Y, EN GENERAL, EN TODA CLASE DE INMUEBLES Y EVENTOS. 5) LA ATENCIÓN DE LOS SERVICIOS DE URGENCIA, PREVENCIÓN, INFORMACIÓN, CENTRALITA DE TELÉFONOS, COCINA Y COMEDORES. 6) LA APERTURA, CIERRE Y CUSTODIA DE LLAVES, RECEPCIÓN, COMPROBACIÓN DE VISITANTES Y ORIENTACIÓN DE LOS MISMOS, ASÍ COMO CONTROL DE ENTRADAS, DOCUMENTOS O CARNETS PRIVADOS EN CUALQUIER CLASE DE EDIFICIOS O INMUEBLES. 7) EL ENCENDIDO Y APAGADO, MANEJO, SUPERVISIÓN, ENTRETENIMIENTO Y REPARACIÓN DE LOS MOTORES E NISTALACIONES DE CALOR, FRÍO, Y ELECTRICIDAD, DE LOS ASCENSORES, DE LOS CENTRO DE ALMACENAMIENTO Y DE LAS CONDUCCIONES DE AGUA, GAS Y OTROS SUMINISTROS DE LOS SISTEMAS Y APARATOS DE PREVENCIÓN Y LUCHA CONTRA INCENDIOS, INCLUSO RETIMBRADO Y RECARGA DE EXTINTORES. 8) LA EXLOTACIÓN DE SISTEMAS DE COMUNICACIÓN RÁPIDA CON SERVICIOS PÚBLICOS ASISTENCIALES: POLICÍA, BOMBEROS, HOSPITALES Y CENTROS MÉDICOS. 9) LA EJECUCIÓN DE LABORES RELACIONADAS CON EXPLOTACIONES PECUARIAS: CLASIFICACIÓN DE HUEVOS, ORDEÑADO, VACUNACIÓN, LIMPIEZA, DESINSECTACIÓN, ASISTENCIA A PARTOS DE ANIMALES, FICHAS Y CENSOS DE ANIMALES. GESTIÓN DE EXPLOTACIONES AGRÍCOLAS Y GANADERAS, MATADEROS E INDUSTRIAS LÁCTEAS, MANIPULACIÓN, SEPARACIÓN, CLASIFICACIÓN, ETIQUETADO Y EMBALAJE DE LOS PRODUCTOS PROCEDENTES DE DICHAS INDUSTRIAS. 10) SERVICIOS DE PREVENCIÓN, PROTECCIÓN Y LUCHA CONTRA INCENDIOS EN GENERAL, INCLUYENDO LA GESTIÓN DE LOS RECURSOS HUMANOS NECESARIOS PARA TALES FINES. 11) SERVICIOS Y CONSULTORÍA RELACIONADOS CON LA PROMOCIÓN Y VENTA DE PRODUCTOS, INCLUYENDO LA ATENCIÓN A CLIENTES Y USUARIOS, PROMOCIONES Y TELEMARKETING, REALIZACIÓN DE CAMPAÑAS Y PRESTACIÓN DE MERCHANDISING, DEGUSTACIÓN, DISTRIBUCIÓN DE MUESTRAS Y REPOSICIÓN DE PRODUCTOS, ASÍ COMO EL ASESORAMIENTO A EMPRESAS EN TODO LO RELACIONADO CON LO ANTERIOR, EN INSTALACIONES PROPIAS O DE TERCEROS, INCLUSO A TRAVÉS DEL EJERCICIO DE LA AGENCIA. 12)SERVICIOS DE PUBLICIDAD, MEDIANTE ANUNCIOS, CARTELES, FOLLETOS, PELÍCULAS PUBLICITARIAS, ETC., A TRAVÉS DE PRENSA, RADIO, TELEVISIÓN, PUBLICIDAD AÉREA U OTROS MEDIOS. COLOCACIÓN Y REPOSICIÓN DE MATERIAL PUBLICITARIO EN VALLAS Y OTROS ESPACIOS RESERVADOS PARA ESTE FIN.&#13;
13) SERVICIOS DE GUARDERÍA, ACOMPAÑAMIENTO, CUSTODIA Y CUIDADO DE MENORES. REALIZACIÓN DE ACTIVIDADES ESCOLARES Y EXTRAESCOLARES, REFUERZO EDUCATIVO, CAMPAMENTOS, LUDOTECAS Y ACTIVIDADES EDUCATIVAS, SOCIALES Y CULTURALES. LA PRESTACIÓN DE SERVICIOS RELACIONADOS CON LA ENSEÑANZA. 14) SERVICIOS DE GESTIÓN DE COBROS DE RECIBOS, INCLUSO LOS CORRESPONDIENTES A SERVICIOS DE LAS ADMINISTRACIONES PÚBLICAS. 15) REALIZACIÓN DE ENCUESTAS, TRABAJOS DE CAMPO Y TOMAS DE DATOS PARA ESTUDIOS DE MERCADO, ESTADOS DE OPINIÓN Y OTRO TIPO DE AVERIGUACIONES. 16) SERVICIOS DE LECTURA DE CONTADORES, AGUA, GAS O CUALQUIER OTRO TIPO DE SUMINISTRO, CORTE, MANTENIMIENTO, REPARACIÓN Y REPOSICIÓN DE LOS MISMOS, ESCUCHA Y TRANSCRIPCIÓN DE LECTURAS, INSPECCIÓN DE CONTADORES, TOMA Y ACTUALIZACIÓN DE DATOS Y COLOCACIÓN DE AVISOS. 17) GESTIÓN, ORGANIZACIÓN, ATENCIÓN Y EXPLOTACIÓN DE BIBLIOTECAS, ARCHIVOS Y MUSEOS. 18)TRABAJOS EDITORIALES Y DE IMPRENTA, ASÍ COMO LOS DE IMPRESIÓN, ENCUADERNACIÓN Y ACABADO DE LIBROS, DE COMPOSICIÓN Y ESTEREOTIPIA, DE REPRODUCCIÓN DE MATERIAL GRABADO EN INSTALACIONES PROPIAS O DE TERCEROS. 19) TRABAJOS DE VIGILANCIA, CUIDADO Y CONTROL PARA LA PROTECCIÓN DE ESPECIES ANIMALES, ASÍ COMO SUS TRATAMIENTOS SANITARIOS. VACUNACIÓN, SANEAMIENTO, CONTROL SANITARIO Y BIENESTAR DE ANIMALES, MERCADOS Y EXPLOTACIONES GANADERAS. 20) GESTIÓN DE CABINAS TELEFÓNICAS, INCLUYENDO SU MANTENIMIENTO, LIMPIEZA, RECAUDACIÓN, CONTEO Y SUSTITUCIÓN DE CARTELES PUBLICITARIOS. 21) GESTIÓN Y EXPLOTACIÓN DE SERVICIOS DE RETIRADA DE VEHÍCULOS DE LA VÍA PÚBLICA Y DE DEPÓSITOS DE VEHÍCULOS, ASÍ COMO EL CONTROL DE APARCAMIENTOS REGULADOS. 22) GESTIÓN DE INVENTARIOS, DE ESPACIOS, DE ARCHIVOS Y TRABAJOS COMPLEMENTARIOS DE ESTAS ACTIVIDADES: CLASIFICACIÓN, INDEXACIÓN Y CUSTODIA, DIGITALIZACIÓN, CLASIFICACIÓN Y ARCHIVO. 23) ORGANIZACIÓN Y PROMOCIÓN DE CONGRESOS, FERIAS Y EXPOSICIONES, DISPOSICIÓN Y DISTRIBUCIÓN DE ESPACIOS, MONTAJE Y DESMONTAJE DE ESTRUCTURAS. 24) REALIZACIÓN DE LABORES PROPIAS DE LA ADMINISTRACIÓN DE FINCAS. 25) LA CARGA, DESCARGA, ESTIBA Y DESESTIBA, EL TRANSPORTE, DISTRIBUCIÓN, MANIPULACIÓN, ENVASADO, EMBALAJE, CONTROL DE CALIDAD, COLOCACIÓN, CLASIFICACIÓN Y ALMACENAMIENTO DE TODO TIPO DE MERCANCÍAS, EXCLUIDAS LAS ACTIVIDADES SOMETIDAS LEGISLACIÓN ESPECIAL. 26) GESTIÓN DE ALMACENES DE MERCANCÍAS, APROVISIONAMIENTO Y EVACUACIÓN DE LÍNEAS DE PRODUCCIÓN. SERVICIOS DE VERIFICACIÓN DE PRODUCTOS. SERVICIOS DE DEPÓSITO Y ALMACENAJE DE MERCANCÍAS, VEHÍCULOS, MUEBLES, DOCUMENTOS, PELÍCULAS Y OTROS ENSERES. DEPÓSITO EN ALMACENES ESPECIALES, TALES COMO SILOS Y OTROS ALMACENES DE GRANOS, ALMACENES FRIGORÍFICOS Y ALMACENES Y DEPÓSITO DE LÍQUIDOS, TODO ELLO EN CENTROS PROPIOS O DE TERCEROS, ASÍ COMO CUALQUIER OTRA OPERACIÓN O PROCESO REFERIDO AL MOVIMIENTO, MANIPULACIÓN, PREPARACIÓN ENLATADO, ENVASADO Y EMBALADO DE MATERIALES Y/O MERCANCÍAS SUSCEPTIBLES DE DICHAS OPERACIONES. 27) LA RECOGIDA, TRANSPORTE, DISTRIBUCIÓN, ALMACENAMIENTO, CUSTODIA Y ENTREGA DE TODA CLASE DE PAQUETES, MERCANCÍAS Y TODO TIPO DE DOCUMENTOS, YA SEA POR CUENTA PROPIA O AJENA, TRATAMIENTO Y ARCHIVO DE DICHOS DOCUMENTOS EN CUALQUIER TIPO DE SOPORTE, INCLUÍDA LA DIGITALIZACIÓN O CUALQUIER OTRO SISTEMA TECNOLÓGICO, EXCLUIDAS LAS ACTIVIDADES SOMETIDAS A LEGISLACIÓN  ESPECIAL, Y CON SUJECIÓN A LO DISPUESTO EN LAS DISPOSICIONES LEGALES VIGENTES SOBRE REGULACIÓN DEL TRATAMIENTO AUTOMATIZADO DE LOS DATOS DE CARÁCTER PERSONAL. 28) SERVICIO DE RECADERÍA, DE REPARTO, MANIPULACIÓN Y FRANQUEO DE CORRESPONDENCIA, ASÍ COMO LOS DE DISTRIBUCIÓN DE PAQUETERÍA, PUBLICACIONES Y MATERIAL DE ARTES GRÁFICAS, INCLUÍDOS LOS TRABAJOS ADMINISTRATIVOS DE DISTRIBUCIÓN Y ARCHIVO DE PUBLICACIONES Y OTROS DOCUMENTOS. 29) SERVICIOS DE DÁRSENA, MARINERÍA, RECEPCIÓN, AMARRE, CONEXIÓN Y MANEJO DE EMBARCACIONES A MOTOR, EN TODO TIPO DE PUERTOS. 30) SERVICIOS DE GESTIÓN, CONTROL Y SEGUIMIENTO DE CENTROS DE PESCA, LONJAS Y MERCADOS. 31) EL ESTUDIO DE CLIMAS  SONOROS Y DE PERTURBACIONES POR RUIDOS, DE SUS EFECTOS, ASÍ COMO DE LAS SOLUCIONES A LAS MISMAS, MEDIANTE LA EJECUCIÓN DE LAS PERTINENTES MEDIDAS CORRECTORAS ENCAMINADAS A DISMINUIR LAS EMISIONES Y DESARROLLANDO AQUELLAS ACTUACIONES QUE EL MINISTERIO DE INDUSTRIA DETERMINE PARA SUS ENTIDADES COLABORADORAS, DE ACUERDO CON LO ESTABLECIDO EN LA NORMATIVA VIGENTE SOBRE LA MATERIA. 32) LA GESTIÓN Y CONTROL, A TRAVÉS DE UN CENTRO INFORMATIZADO Y AMPLIAMENTE COMUNICADO, DE CUALQUIERA DE LOS SERVICIOS MENCIONADOS EN LOS NÚMEROS ANTERIORES, TANTO SI SON PRESTADOS POR LA PROPIA SOCIEDAD O POR TERCEROS. 33) LA EJECUCIÓN DE ESTUDIOS SOBRE ORGANIZACIÓN, MÉTODOS, SISTEMAS Y TIEMPOS, EN RELACIÓN CON LA PRESTACIÓN DE TODOS LOS SERVICIOS INCLUIDOS EN EL OBJETO SOCIAL. 34) LA PUBLICACIÓN DE INFORMES, REVISTAS, LIBROS Y OTROS TRABAJOS LITERARIOS SOBRE LOS CITADOS SERVICIOS. 35) PRESTACIÓN DE TODO TIPO DE SERVICIOS SOCIALES, SANITARIOS, EDUCATIVOS Y DE OCIO, MEDIANTE PERSONAL CUALIFICADO, EN CENTROS PROPIOS O DE TERCEROS, A TODO TIPO DE COLECTIVOS, QUEDANDO EXPRESAMENTE INCLUIDOS, ENTRE OTROS, LOS SIGUIENTES SERVICIOS: &#13;
-TELEASISTENCIA DOMICILIARIA  Y SOCIO-SANITARIA.&#13;
-TRASLADO Y ACOMPAÑAMIENTO, INCLUSO MEDIANTE TRANSPORTE ADAPTADO.&#13;
-SERVICIO DE AYUDA A DOMICILIO&#13;
-ATENCIÓN SOCIAL, MÉDICA Y DE ENFERMERÍA A DOMICILIO.&#13;
-HOSPITALIZACIÓN A DOMICILIO.&#13;
-EXPLOTACIÓN O GESTIÓN, TOTAL O PARCIAL DE CENTROS DE DÍA, PISOS TUTELADOS, COMUNIDADES TERAPÉUTICAS, RESIDENCIAS, HOSPITALES, CENTROS DE ENFERMOS MENTALES Y OTROS CENTROS DE ACOGIDA Y REHABILITACIÓN.&#13;
-ELABORACIÓN DE PLANES DE ATENCIÓN INTEGRAL DE MAYORES, ASÍ COMO DE PLANES PSICOGERIÁTRICOS Y DE ATENCIÓN A ENFERMOS MENTALES.&#13;
-EXPLOTACIÓN O GESTIÓN, TOTAL O PARCIAL, DE GUARDERÍAS Y ESCUELAS INFANTILES, DE CENTROS DE DÍA, PISOS TUTELADOS, COMUNIDADES TERAPÉUTICAS, RESIDENCIAS  PARA PERSONAS MAYORES Y CENTROS DE ENFERMOS MENTALES.&#13;
-PRESTACIÓN DE SERVICIOS DE CUIDADO Y CUSTODIA DE NIÑOS EN ESTANCIAS Y LOCALES APROPIADOS.&#13;
-PRESTACIÓN DE SERVICIOS DE CONSULTORÍA, INVESTIGACIÓN Y DESARROLLO EN RELACIÓN CON LOS SERVICIOS SOCIALES Y SANITARIOS. 36) PRESTACIÓN DE SERVICIOS SANITARIOS MEDIANTE PERSONAL CUALIFICADO EN CENTROS PROPIOS O DE TERCEROS, QUEDANDO EXPRESAMENTE INCLUIDOS, ENTRE OTROS, LOS SIGUIENTES SERVICIOS:&#13;
-EXPLOTACIÓN Y GESTIÓN DE UNIDADES DE PROCESAMIENTO DE MATERIAL SANITARIO, MEDIANTE TÉCNICAS DE LAVADO, DESINFECCIÓN, ALTA DESINFECCIÓN, ESTERILIZACIÓN POR DIFERENTES SISTEMAS U OTRAS, CON UTILIZACIÓN DE TECNOLOGÍAS ADECUADAS, SU DISEÑO, PROYECTO, EQUIPAMIENTO Y MANEJO.&#13;
